package com.gdlgxy.internshipcommunity.constant;import java.lang.annotation.Retention;import java.lang.annotation.RetentionPolicy;import androidx.annotation.StringDef;import static com.gdlgxy.internshipcommunity.constant.PageName.INTERNSHIP;import static com.gdlgxy.internshipcommunity.constant.PageName.MAIN;import static com.gdlgxy.internshipcommunity.constant.PageName.PAGE_HOME;@StringDef({MAIN,PAGE_HOME,INTERNSHIP})@Retention(RetentionPolicy.SOURCE)public @interface PageName {    String MAIN = "main";    String PAGE_HOME = "HomePage";    String INTERNSHIP = "internship";}